import React, {Component} from 'react';
import './style.css';
import 'bootstrap/dist/css/bootstrap.min.css';  


import 'bootstrap/dist/js/bootstrap'; 
import 'bootstrap/node_modules/jquery/dist/jquery'; 
import ReactCSSTransitionGroup from 'react-addons-css-transition-group';


class Navbar extends Component {

    goPage() {
        return (
            <ReactCSSTransitionGroup
                component={this.FirstChild}
                transitionName='hide'
                transitionEnterTimeout={300}
                transitionLeaveTimeout={300}>
                <div className="alert-con" style={this.state.alertStatus? {display:'block'}:{display:'none'}}>
                <div className="alert-context">
                    <div className="alert-content-detail">{this.state.alertTip}</div>
                    <div className="comfirm" onClick={this.confirm}>确认</div>
                </div>
                </div>
            </ReactCSSTransitionGroup>
        );
    }

    render() {
        return ( 
            <div>
                <nav class="navbar navbar-expand-sm bg-dark navbar-dark fixed-top">
                    <a class="navbar-brand" href="#">Logo</a>
                </nav>

                <div>
                <nav class="navbar bg-light nav-vertical">
                    <ul class="navbar-nav">
                        <li class="nav-item">
                            <a class="nav-link" href="#" onClick={this.goPage}>主页</a>
                        </li>
                        <li class="nav-item">
                            <a class="nav-link" href="#">MENU 1</a>
                        </li>
                        <li class="nav-item">
                            <a class="nav-link" href="#">MENU 2</a>
                        </li>
                    </ul>
                </nav>

                <div class="dash_body">

                </div>
                </div>


            </div>

        );
    }

}

export default Navbar;
